export default {
  props: ['base', 'totalPages', 'currentPage'],
  computed: {
    showPreviousPage() {
      return this.currentPage !== 1;
    },
    previousPage() {
      return [0, 1].includes(this.currentPage - 1) ? this.base : `${this.base}/${this.currentPage - 1}`;
    },
    showNextPage() {
      return this.currentPage !== this.totalPages;
    },
    nextPage(currentPage, totalPages) {
      return this.totalPages > this.currentPage ? `${this.base}/${this.currentPage + 1}` : `${this.base}/${this.currentPage}`;
    }
  }
};
